var myApp=angular.module("myApp",[]);myApp.controller("TaskController",["$scope",function(a){a.tasklist=[],a.addTask=function(){a.tasklist.push({task:a.input,done:!1}),a.input="",console.log(a.tasklist)},a.clearChecked=function(){for(var b=0;b<a.tasklist.length;b++)a.tasklist[b].done===!0&&a.tasklist.splice(b,a.tasklist.length)}}]);